    })
    return (
        <>
            <div className="box">
                <h2 className="sub-heading">High scores: {country.name}</h2>
                <table>
                    <tbody>
                        {sortedScores.map((score, index) => {
                            return (
                                <tr key={index}>
                                    <td>{score.n.toUpperCase()}</td>
